.wrapper {
  height: 95vh;
  width: 100%;
  display: flex;
  justify-content: center;
  align-items: center;
}

@keyframes loading {
  from {
    width: 0%;
  }
  to {
    width: 100%;
  }
}

@media (max-width: 1080px) {
  .wrapper {
    p {
      font-size: 48px;
    }
  }
}

@media (max-width: 539px) {
  .wrapper {
    p {
      font-size: 32px;
    }
  }
}
